pragma solidity ^0.8.10;

library Shared {
    struct RealState {
        uint registration;
        string city;
        string street;
        uint number;
        uint meters;
        uint price;
        string owner;
        uint timestamp;
        address requester;
    }
}

contract RealStateContractCities {
    mapping(string => Shared.RealState[]) public realStateMap;
    address payable public admin  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);
    mapping(address => bool) public authorizedAddresses;
    Shared.RealState[] public history;

    constructor() {
        authorizedAddresses[admin] = true;
    }

    modifier onlyAdministrator() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    modifier onlyAuthorized() {
        require(authorizedAddresses[msg.sender], "Only authorized addresses can call this function");
        _;
    }

    function addAuthorizedAddress(address _address) public onlyAdministrator {
        authorizedAddresses[_address] = true;
    }

    function removeAuthorizedAddress(address _address) public onlyAdministrator {
        authorizedAddresses[_address] = false;
    }

    function getRealStateByCity (string calldata _city) public view returns(Shared.RealState[] memory) {
        if (authorizedAddresses[msg.sender]) {
            return realStateMap[_city];
        } else {
            Shared.RealState[] memory realStateMapWithoutPrice = realStateMap[_city];
            for (uint i = 0; i < realStateMap[_city].length; i++) {
                realStateMapWithoutPrice[i].price = 0;
            }
            return realStateMapWithoutPrice;
        }
    }

    function addRealState (Shared.RealState calldata realState) public onlyAuthorized {
        uint indexToUpdate = getRealState(realState);

        if (indexToUpdate != type(uint).max) {
            realStateMap[realState.city][indexToUpdate] = realState;
        } else {
            realStateMap[realState.city].push(realState);
        }

        history.push(realState);
    }

    function getRealState(Shared.RealState calldata realState) public view returns(uint) {
        for(uint i = 0; i < realStateMap[realState.city].length; i++){
            if (realStateMap[realState.city][i].registration == realState.registration){
                return i;
            }
        }
        return type(uint).max;
    }

    function deleteRealState(Shared.RealState calldata realState) public onlyAuthorized {
        for(uint i =0; i < realStateMap[realState.city].length; i++){
            if (realStateMap[realState.city][i].registration == realState.registration){
                delete realStateMap[realState.city][i];

                for(uint j =i; j < realStateMap[realState.city].length-1; j++){
                    realStateMap[realState.city][j] = realStateMap[realState.city][j+1];
                }

                realStateMap[realState.city].pop(); // delete the last
                // Important to reduce -1 the leght of array

                return; // for finish method
            }
        }
    }

    function getHistory() public view onlyAuthorized returns(Shared.RealState[] memory) {
        require(history.length > 0, "History is still empty");
        return history;
    }
}

contract RealStateContract{
    using Shared for Shared.RealState;

    Shared.RealState[] public realStateArray;
    address payable public admin  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);
    mapping(address => bool) public authorizedAddresses;
    Shared.RealState[] public history;

    constructor() {
        authorizedAddresses[admin] = true;
    }

    modifier onlyAdministrator() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    modifier onlyAuthorized() {
        require(authorizedAddresses[msg.sender], "Only authorized addresses can call this function");
        _;
    }

    function addAuthorizedAddress(address _address) public onlyAdministrator {
        authorizedAddresses[_address] = true;
    }

    function removeAuthorizedAddress(address _address) public onlyAdministrator {
        authorizedAddresses[_address] = false;
    }

    function addRealState(Shared.RealState calldata realState) public onlyAuthorized {        
        uint indexToUpdate = getRealStateByRegistration(realState.registration);

        if (indexToUpdate != type(uint).max) {
            realStateArray[indexToUpdate] = realState;
        } else {
            realStateArray.push(realState);
        }

        history.push(realState);
    }

    function getRealStateByRegistration (uint _registration) public view returns(uint) {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                return i;
            }
        }
        return type(uint).max;
    }

    function deleteRealStateByRegistration(uint _registration) public onlyAuthorized {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                delete realStateArray[i];

                for(uint j =i; j < realStateArray.length-1; j++){
                    realStateArray[j] = realStateArray[j+1];
                }

                realStateArray.pop(); // delete the last
                // Important to reduce -1 the leght of array

                return; // for finish method
            }
        }
    }

    function getRealStateByCity (string calldata _city) public view returns(Shared.RealState[] memory) {
        uint resultLength = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                resultLength++;
            }
        }
        Shared.RealState[] memory rsReturn = new Shared.RealState[](resultLength);

        uint positionInsert = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                rsReturn[positionInsert] = realStateArray[i];
                positionInsert++;
            }
        }

        if (authorizedAddresses[msg.sender]) {
            return rsReturn;
        } else {
            Shared.RealState[] memory realStateMapWithoutPrice = rsReturn;
            for (uint i = 0; i < rsReturn.length; i++) {
                realStateMapWithoutPrice[i].price = 0;
            }
            return realStateMapWithoutPrice;
        }
    }

    function getHistory() public view onlyAuthorized returns(Shared.RealState[] memory) {
        require(history.length > 0, "History is still empty");
        return history;
    }
}
